import React from 'react';

function Header(props) {
    return (
        <header>
            <div>
                <span className='logo'>Hause Staff</span>
                <nav>
                    <ul className='menu'>
                        <li><a href='#'>Про нас</a></li>
                        <li><a href='#'>Контакты</a></li>
                        <li><a href='#'>Ка</a></li>
                    </ul>
                </nav>
            </div>
            <div className='presintation'></div>
        </header>
    );
}

export default Header;
